Like 98% of U.S. citizens (including the President), I am the descendant of immigrants&mdash;my great-grandparents came to America from Russia and Lithuania as teenagers and worked in sweatshops until they were able to afford to bring the rest of their families over. Most everyone you speak to in this country has a similar story to tell, because we are, in fact, a nation of immigrants, bound together by a shared belief in justice, equality, and the freedom to pursue a better life. In this context, last week&rsquo;s Executive Order barring immigrants and refugees from seven Middle Eastern countries from entering the United States is not simply immoral, it violates the very spirit and foundation of America.
Contrary to the assertions of the current administration, the order will not make us safer (an opinion shared by the State Department and many members of Congress including prominent Republicans). Christian religious leaders have denounced both the ban, as well as the exception prioritizing Christian immigrants, as inhumane. It is an unequivocal moral wrong, a cynical attempt to sow division among the American people, and is in direct opposition to the principles of a country where the tenet of religious freedom is written directly into the Constitution. This is not who we are, and it is not what we believe in. We at Bandcamp oppose the ban wholeheartedly, and extend our support to those whose lives have been upended.
And so on Friday, for any purchase you make on Bandcamp, we will be donating 100% of our share of the proceeds to the American Civil Liberties Union, who are working tirelessly to combat these discriminatory and unconstitutional actions.
As another way of showing solidarity with the immigrants and refugees from the seven banned countries&mdash;as well as those impacted by the construction of the Mexican border wall&mdash;we&rsquo;ve compiled a list of albums made by artists from the affected countries (Bandcamp may be based in the United States, but we host artists from every corner of the world). We believe that knowledge and empathy are crucial weapons against fear and intolerance. We hope that, as you listen to these albums, you&rsquo;ll not only discover some great new artists, but will also gain a further appreciation and understanding for the way music transcends all borders, and remember that, even in the darkest of times, there is more that unites us than divides us.
&mdash; Ethan Diamond, Bandcamp Founder &amp; CEO


Mexico&nbsp;
Deseo de Muerte&nbsp;

A dreamy pair of tracks from this Mexico City darkwave duo. &ldquo;Las paredes&rdquo; keeps the pace of a racing heart; a ticking drum machine and synth harmonics push forward interwoven heavenly vocal melodies and luxe, washed-out ribbons of guitar. &ldquo;Olvida&rdquo; is made for the slow sway of the goth club floor. &mdash;Jes Skolnik&nbsp;
FZ-10&nbsp;

Fierce raw punk with the kind of clattering d-beat that sounds like it&rsquo;s going to topple over and into itself at any point; its sonic precarity makes it feel all the more urgent. Rippling vocal delay, buzzsaw guitars, a blur of bass: the band says this is a demo (their debut LP came out in 2014), but it sounds better-recorded and more energetic than some official albums we&rsquo;ve heard recently. The harsh howl near the end of &ldquo;Muerte en la ciudad&rdquo; will make the hair on your arms stand straight up.&nbsp;&mdash;Jes Skolnik&nbsp;
Syria&nbsp;
Omar Souleyman&nbsp;

A mournful electrified Syrian oud cries alone on stage, joined eventually by another before the powerful and equally mournful voice of Omar Souleyman joins them on&nbsp;&ldquo;Mawal Hejaz,&rdquo; the opening track of&nbsp;Haflat Gharbia: The Western Concerts. Western ears may already be familiar with Souleyman&rsquo;s electro-infused Syrian folk-pop. Souleyman began his career as a singer for wedding parties in northeastern Syria and gained fame throughout the country and the rest of the Arab world through distribution of live recordings on tapes and CDs, eventually reaching a global audience. This album captures the best moments of his live shows between 2009 and 2011, culminating in a groundbreaking performance at the Glastonbury festival. &mdash;Ally-Jane Grossan&nbsp;
Theoria&nbsp;

There&rsquo;s no shortage of Syrian metal&mdash;in fact a crowdfunding campaign recently reached its goal to make a documentary about the scene. Theoria is Syria&rsquo;s best example of atmospheric black metal, echoing the languid, yet punishing, tempo of their American and European counterparts (the band cites Chaos Moon, Cloudkicker,&nbsp;Darkspace, and&nbsp;Lunar Aurora&nbsp;as influences). Based in the northern Syrian city of Aleppo, the two members (identified as&nbsp;Ahmad and Besher) previously&nbsp;released death metal as Crescent&nbsp;Moon but on Mantra, their debut as Theoria (released by French label Antiq), the guitar sound becomes&nbsp;elegant and the&nbsp;vocals less guttural. &mdash;Ally-Jane Grossan&nbsp;
Iraq&nbsp;
Wirephobia&nbsp;

One of the more prolific Iraqi artists on Bandcamp, the Erbil-based Wirephobia has over 40 releases of discordant, experimental noise, including several split singles with other noise artists from around the globe. &ldquo;Kurdistan&rdquo; is one of his more accessible releases (although those with sensitive ears should still be wary of turning up the volume), featuring samples of Middle Eastern music that drop suddenly into wells of harsh and crackling noise. It was released as an 8-track cartridge and a very limited edition 12-inch by Rochester, New York-based noise label Useless Prick. &mdash;Mariana Timony&nbsp;
Dark Phantom&nbsp;

If you like your metal ultra-raw and super fast, you&rsquo;re going to love Dark Phantom, Iraq&rsquo;s first thrash band. Their backstory is as intense as their music. Started in 2007 as a way to express both their love of metal and their feelings about the shitty situation in their home city of Bagdhad, the band struggled to achieve their dreams as a result of the Iraq war, with members frequently having to go into hiding for their own safety. It took until 2016 for their pummeling, brutal debut Nation of Dogs to makes its debut. As a metal record, it slays. As a testament of the band&rsquo;s will to survive, it is a powerful paean to the human spirit. Dark Phantom&rsquo;s bio puts it best: &ldquo;Music itself means life.&rdquo; &mdash;Mariana Timony&nbsp;
Iran 
Akvan

Akvan, named for a Zoroastrian demon who represents the concept of &ldquo;evil mind&rdquo; or &ldquo;evil intention,&rdquo; blends atmospheric black metal and traditional Iranian folk music to gorgeous, seamless, and unique effect. This is music both deeply visceral and deeply hypnotic. The lyrics pull from classic texts like the Shanameh (&ldquo;Book of Kings&rdquo;), the epic poetic retelling of Iranian history that is Iran&rsquo;s answer to the Mahabharata. Be on the lookout, as we&rsquo;ve got an interview with Akvan coming in the next few weeks you won&rsquo;t want to miss. &mdash;Jes Skolnik&nbsp;
Arsha Samsaminia&nbsp;

Tehran&rsquo;s Arsha Samsaminia enlists a global cast of luminaries from the contemporary classical world, including the Stockholm Saxophone Quartet, Japanese violinist Ken Aiso (who studied in London at the Royal Academy of Music and currently resides in L.A.), the Georgian Tbilisi Contemporary Ensemble (conducted by pianist Nino Jvania), and Italian pianist Andrea Dindo, to play a set of his new compositions. Full of space and ambience, these elegant works are haunting, particularly &ldquo;Disabling a Bomb Inside the Piano,&rdquo; which is as tense, delicate, and evocative as its name would suggest.&mdash;Jes Skolnik&nbsp;
Libya&nbsp;
Awal Akalin

